import React from 'react';
import Header from './Header';
import SideBar from './Sidebar';
import SmallBox from './SmallBox';
import LongBox from './LongBox';
import HorzBox from './HorzBox';
import LargeBox from './LargeBox';
import AssetsBox from './AssetsBox';
import './App.css';

function App() {
  return (
    <div className="app">
      {/* Header */}
      <Header />
      {/* Left SideBar */}
      <SideBar />
      {/* SmallBox - Balance */}
      <SmallBox className="balance"/>
      {/* SmallBox - Bitcoin */}
      <SmallBox className="bitcoin"/>
      {/* SmallBox - Terracoin */}
      <SmallBox className="terracoin"/>
      {/* SmallBox - ZCoin */}
      <SmallBox className="zcoin"/>
      {/* SmallBox - Ethereum */}
      <SmallBox className="ethereum"/>
      {/* LongBox - Recent Operations */}
      <LongBox />
      {/* HorizontalBox - Buy/Sell Coins */}
      <HorzBox />
      {/* LargeBox - Graph (BTC) */}
      <LargeBox data={36,36,36,37,38,38,39,41,41,42,43,43,43,45,46,46,47,48,48,49,49,50,52,53,54,54,55,55,56,56,56,56,57,57,57,57,57,59,59,59,60,63,63,64,64,65,66,66,67,67,67,68,68,68,70,70,71,72,72,72,73,74,75,76,76,77,78,78,79,80,80,80,82,82,82,83,85,85,86,86,88,88,88,90,90,92,92,92,92,94,94,94,95,96,96,96,97,97,98,98,98,98,99,99,100,26,27,27,27,30,31,31,32,32,32,32,33,33,35,35,36,36,36,37,38,38,39,41,41,42,43,43,43,45,46,46,47,48,48,49,49,50,52,53,54,54,55,55,56,56,56,56,57,57,57,57,57,59,59,59,60,63,63,64,64,65,66,66,67,67,67,68,68,68,70,70,71,72,72,72,73,74,75,76,76,77,78,78,79,80,80,80,82,82,82,83,85,85,86,86,88,88,88,90,90,92,92,92,92,94,94,94,95,96,96,96,97,97,98,98,98,98,99,99,100}/>
      {/* LargeBox - Graph (TRC)*/}
      {/* LargeBox - Graph (XZC)*/}
      {/* LargeBox - Graph (ETC)*/}
      {/* SmallBox (Unique Props) - Assets*/}
      <AssetsBox />
    </div>
  );
}

export default App;
